    return(
        <div>
            {searchedItems.map((item) => (
                <FoodItem key={item.id} item={item} setFoodItem={setFoodItem} foodItemselectedMeal= {selectedMeal} addToFoodList={addToFoodList} currentUser={currentUser} currentFoodResponse={currentFoodResponse} setTotalCaloriesIAte={setTotalCaloriesIAte}/> ))}
        </div>
    )
}

export default FoodItemsList;
